function GetRFPs(classname, RFPId = null, RFPName = null) {
  var filter_val = JSON.stringify({
    IsActive: true,
  });
  var result = callgetlist("GetActiveRFP");
  var options = "<option value=''>Select RFP</option>";
  if (RFPId != null && RFPName != null) {
    options += "<option value='" + RFPId + "'>" + RFPName + "</option>";
  }
  //console.log("GetActiveRFP" , result);
  for (var i = 0; i < result.length; i++) {
    FormatDate = result[i].RFPDate.split("T")[0];
    options +=
      "<option value='" +
      result[i].RRFNo +
      "'> [" +
      result[i].BDEName +
      "] - " +
      result[i].Client +
      " - [" +
      FormatDate +
      "] </option>";
  }
  $("." + classname).html(options);
}

