function AddClientDetails() {
  var err = 0;
  var RFPId = $("#ProposalRfplist").val();

  var DocumentType = $("input[name='DocumentType']:checked").val();

  var document_name = $("#document_name").val();
  $("#document_name").on('change', () => {
    if (document_name == "") {
      $("#document_name").addClass("required_field");
      $("#document_name").next("span").html("Please Enter Document Name.");
      err++;
    }
  })

  // Temporary solution for contact person
  var contactPerson = $("#contact-person").val();


  var proposalDate = $("#proposalDate").val();
 
  var clientname = $("#client-name").val();
  
  var address = $("#address").val();
  var get_ProposalId = localStorage.getItem("ProposalId");
  var set_ProposalId = "";
  if (get_ProposalId != "") {
    set_ProposalId = get_ProposalId;
  }
  var ClientName = $("#client-name").val();
  var ProposalName = $("#ProposalRfplist option:selected").text();

  var localget = localStorage.getItem("UserCheckRes");
  var jsonData = JSON.parse(localget);
  var EmployeeID = jsonData["Data"][0]["EmployeeID"];

  var ProposalDetails = {
    RFPId: RFPId,
    ProposalName: ProposalName,
    DocumentType: DocumentType,
    DocumentName: document_name,
    OwnerId: EmployeeID,
    ContactPerson: contactPerson,
    ClientId: clientId,
    ClientName: ClientName,
    Date: proposalDate,
    Address: address,
    ProposalId: set_ProposalId,
  };
  data = {
    Method: "PostRFPClientDetails",
    Data: ProposalDetails,
  };

  var postCall = PostDataCall(data);
  if (postCall["IsSuccess"] == true) {

    $("#estimate_number").val(postCall["Data"][0]["EstimateNumber"]);
    localStorage.setItem("ProposalId", postCall["Data"][0]["ProposalId"]);

    return true;
  } else {
    return true;
  }
}

