function GetEstimateRFPDetails(SetProposalId) {
  if (SetProposalId != "") {
    var filter_val = JSON.stringify({
      IsActive: true,
      ProposalId: SetProposalId,
    });
    var result = callgetlist("GetEstimateRFPDetails", filter_val);
    if (result[0]["EstimateNumber"]) {
      $("#estimate_number").val(result[0]["EstimateNumber"]);
      var response = result[0];
     
      $("#client-name").val(response.ClientName);
      $("#address").val(response.Address);
      $("#client-name_inproposal").val(response.ClientName);
      $("#address_inproposal").val(response.Address);
      $("#RFPI_Code").html(response.RFPICode);
      var date = new Date(response.Date);
      (yr = date.getFullYear()),
        (month = date.getMonth() +1),
        (month = month < 10 ? "0" + month : month),
        (day = date.getDate() < 10 ? "0" + date.getDate() : date.getDate()),
        (newDate = yr + "-" + month + "-" + day);

      $("#proposalDate").val(newDate);
      // Api Call for get Contact person based on client id 445 //
      //GetContactPersons(response.ClientId, "contact-person"); // temporary solution 13-08-2019
      if (response.DocumentType == "E") {
        $("#estimation_doc").prop("checked", true);
      } else if (response.DocumentType == "U") {
        $("#understanding_doc").prop("checked", true);
      } else if (response.DocumentType == "C") {
        $("#clarification_doc").prop("checked", true);
      } else if (response.DocumentType == "P") {
        $("#proposal_doc").prop("checked", true);
      }
      GetRFPs("ProposalRfplist", response.RFPId, response.RFPName);
      // Api Call for get Contact person based on client id 445 //
      //$("#contact-person").val(response.ContactPersonId); // temporary solution 13-08-2019
      $("#contact-person").val(response.ContactPerson);
      $("#document_name").val(response.DocumentName);

      // $("#ProposalRfplist").val(response.RFPId);
      $("#ProposalRfpTitle").html("Proposal Name- " + response.RFPName);

      $(".proposal_modal_title").html(
        "RFP to Proposal - <small style='color:white'><b>" +
          response.RFPName +
          "</b></small>"
      );
    }
  } else {
  }
}

