function openCommentsHistoryForProposals(RfpId,projectName)
{
  $('#commentsHistoryProposalModal').modal('show');
  $('#proposal_RFPID').val(RfpId);
  var CommentsContent = new Array();
  $('#commentsHistoryProposalModalTitle').html("Comments And Documents - "+projectName);
  var GetCommentsInProposalsFilter = JSON.stringify({
    "RFPId": RfpId,
    "IsActive":1
  });
  var GetProposalsCOmmentsHistory = callgetlist("GetCommentsinRFP", GetCommentsInProposalsFilter);
  var ProposalsCommentsHistoryHtml = "";
  var ProposalsNoCommentsCount = 0;
  var ProposalsNoDocumentsCount = 0;
  GetProposalsCOmmentsHistory.forEach(function(item){
    var ProposalsCommentCreatedDate = new Date(item.CreatedDate);
    var ProposalsCommentDateMonthYear = ProposalsCommentCreatedDate.toLocaleDateString();
    var ProposalsCommentTime = ProposalsCommentCreatedDate.toLocaleTimeString();
    if(item.DocumentType == "Comment" && item.Content != null)
    {
      CommentsContent[item.Id] = item.Content.toString();
      $colon = (item.EmployeeName != " ")?':':'';
      ProposalsCommentsHistoryHtml += "<small class='pull-left' style='padding-top:5px'><span>"+item.EmployeeName+$colon+"</span></small>";
      ProposalsCommentsHistoryHtml += "<div class='rfp_comment' onclick=ProposalsCommentSwal('" + item.Id + "')>";
      ProposalsCommentsHistoryHtml += "<small class='pull-right'><span>"+ProposalsCommentDateMonthYear+"</span><span>"+ProposalsCommentTime+"</span></small>";
      var commentElement = $(CommentsContent[item.Id]);
      if(CommentsContent[item.Id].includes("<img"))
      {        
        commentElement.find('img').remove();
        ProposalsCommentsHistoryHtml += "<small>Message contains some image(s) click to expand</small>";
      }
      ProposalsCommentsHistoryHtml += "<label>"+commentElement.html()+"</label></div>";
    }
    if(item.DocumentType == "Document" && item.Content != null)
    {
      $colon = (item.EmployeeName != " ")?':':'';
      ProposalsCommentsHistoryHtml += "<small class='pull-left' style='padding-top:5px'><span>"+item.EmployeeName+$colon+"</span></small>";
      ProposalsCommentsHistoryHtml += "<div class='rfp_comment'>";
      ProposalsCommentsHistoryHtml += "<small class='pull-right'><span>"+ProposalsCommentDateMonthYear+"</span><span>"+ProposalsCommentTime+"</span></small>";
      ProposalsCommentsHistoryHtml += "<small style='padding-bottom:10px'><b>"+item.DocumentName+"."+item.DocumentExtension+" </b></small>";
      ProposalsCommentsHistoryHtml += "<b>Download-file: </b><button class='btn btn-primary btn-xs' onclick=DownloadProposalsDocument('" + item.Id + "')><span class='glyphicon glyphicon-arrow-down'></span></button></div>";
    }
    if(item.DocumentType == "Comment" && item.Content == null)
    {
      ProposalsNoCommentsCount += 1;      
    }
    if(item.DocumentType == "Document" && item.Content == null)
    {
      ProposalsNoDocumentsCount += 1;      
    }
  });
  if(ProposalsNoCommentsCount > 0 && ProposalsNoDocumentsCount > 0 )
  {
    ProposalsCommentsHistoryHtml = "<h3 class='text-center'>There are No Comments and Documents Yet</h3>";
  }
  $("#proposal_comments_history").html(ProposalsCommentsHistoryHtml);
}

function ProposalsCommentSwal(ContentId){
  const wrapper = document.createElement('div');
  wrapper.innerHTML = CommentsContent[ContentId];
  swal({
    title: 'Comment',
    content: wrapper
  });
}

function DownloadProposalsDocument(RfpFileId){
  swal({
    title: "Are you sure?",
    text: "You want to download the File",
    icon: "warning",
    buttons: true,
  })
  .then((willDownload) => {
    if (willDownload) {
      window.open(AssignRfpUrl + "DownloadFile?query=GetDownloadRFPFile&filters={'FileId':'" + RfpFileId + "'}&Token=" + AssignRfpSecurityToken , '_blank');
    }
  });
}

function editProposalData(proposalId, stepnumber, stakeholderType) {
  var CompletedStep = stepnumber == 1 ? 0 : stepnumber - 1;
  stepNumberForAssign = CompletedStep;
  $(".edit_enable").val(1);
  $(".smartwizstep").val(stepnumber);
  localStorage.setItem("ProposalId", proposalId);
  localStorage.setItem("Editpropasl", true);
  localStorage.setItem("stakeholderType", stakeholderType);
  GetEstimateRFPDetails(proposalId);
  if (CompletedStep == 0) {
    GetEstimateRFPDetails(proposalId);
    // Hover highlights disappear in rfp to proposal
    $(
      ".nav-tabs > li.active > a, .nav-tabs > li.active > a:focus, .nav-tabs > li.active > a:hover"
    ).css("background-color", "#46ad46");
    $(
      ".nav-tabs > li.done > a, .nav-tabs > li.done > a:focus, .nav-tabs > li.done > a:hover"
    ).css("background-color", "#eee");
    // end
  }  
  GetEstimateRFPDetails(proposalId);
  GetEstimateCreators(proposalId);
  GetUserStoryandUnderstand(proposalId);
  displayProjectPhase();
  GetProjectPhases("project-phases");
  displayEstimateProjectDetails();
  var success_currency = displayEstimatePricing();
  GetCurrencies("currency");
  $(".currency").val(success_currency);
  GetAssumptionForRFP(proposalId);
  GetDefaultAssumptions();
  GetAssumptionForRFP(proposalId);
  GetOutofScopesForRFP(proposalId);
  GetDefaultOutOfScope();
  techdata("technology", "GetTechnology");
  techdata("environment", "GetEnvironment");
  techdata("backend", "GetBackend");
  getTech();
  GetDefaultOtherNotes();
  GetOtherNotesForRFP(proposalId);
  GetSuggestionsForRFP(proposalId);
  GetDefaultSuggestions();
  GetDeliverableProjectPhases("DeliverableProjectPhase");
  GetProjectDeliverableByDescription("DeliverableDescription");
  displayDeliverableProjectPhase();

  $("#RfpModal").modal("show");
  $("#RfpModal .nav-link").removeAttr("style")
  $("#smartwizard").smartWizard("reset");
  $("#smartwizard").smartWizard("goToStep", CompletedStep);
}

function assignProposalData(proposalId) {
  var stageNumber = stepNumberForAssign;
  var filter_val = JSON.stringify({
    IsActive: true,
    ProposalId: proposalId,
  });
  var result = callgetlist("GetEstimateRFPDetails", filter_val);
  var response = result[0];
  $("#assignProposalModal").modal("show");
  $(".error_message").html("");
  $("#assignProposalModalTitle").html(
    "Assign Proposal - <small style='color:white'><b>" +
      response.RFPName +
      "</b></small>"
  );
  if (stageNumber < 3) {
    $("#btnAssignProposal").attr("disabled", true);
    var options = "<option value=''>---No Values---</option>";
    $("#assignProposalDropDown").html(options);
    $("#assignProposalEmployeeDropDown").html(options);
    $("#assignProposal_err").html(
      "Please complete the necessary steps to assign"
    );
    $("#btnAssignProposal").attr("data-stepnumber", "");
  } else {
    $("#btnAssignProposal").attr("disabled", false);

    $("#btnAssignProposal").attr("data-stepnumber", stageNumber);
    $("#assignProposal_err").html("");
    GetEmployeesByAssignType("", "employeelist");
    GetAssignDropdown("Assign");
  }
}

