function DeleteProposalData(proposalId){
  var filter_val = JSON.stringify({
    IsActive: true,
    ProposalId: proposalId,
  });
  var result = callgetlist("GetEstimateRFPDetails", filter_val);
  var response = result[0];
  var RFP_ICode = result[0]['RFPICode'];
  $("#deleteProposalModal").modal("show");
  $(".error_message").html("");
  $("#ProposalId").html(proposalId);
  $("#RFPICode").html(RFP_ICode);
  // var deleteProposal_comment = CKEDITOR.instances.deleteProposal_comment.getData();
  var deleteProposal_comment = deleteProposal_comment_dxEditor.option("value");
  $("#deleteProposalModalTitle").html(
    "<small style='color:white;font-size:12pt'><b>Closing Proposal For " +
      response.RFPName +
      "</b></small>"
  );
  var filter_val = JSON.stringify({
    Token : AssignRfpSecurityToken
  });
  var Deletestatus = callgetlist("GetDeleteStatusById", filter_val);
  var html;
  html += ' <option value=" " selected disabled>-- Select Status --</option>';
  Deletestatus.forEach(function(key,item){
    html += '<option value="'+key.Id+'">'+key.Status+'</option>';
  });
  $('#deleteProposalDropDown').html(html);
  
}

function close_proposal(){
  var close_comment = deleteProposal_comment_dxEditor.option("value");
  var status_code;
  var status_value = $("#deleteProposalDropDown").val();
  if (status_value == null) {
    $("#deletestatus_err").html('Please select status of the proposal');
    return false;
  }else {
    $("#deletestatus_err").html('');
  }

  if (close_comment == '') {
    $("#deleteProposal_err").html('Please enter the reason for closing the proposals');
    return false;
  }else {
    $("#deleteProposal_err").html('');
  }
  var filter_val = JSON.stringify({
    Token : AssignRfpSecurityToken
  });
  var Deletestatus = callgetlist("GetDeleteStatusById", filter_val);
  // console.log(Deletestatus);
  Deletestatus.forEach(function(key,item){
   
    if(status_value == key.Id){
      status_code = key.Statuscode;

    }
    
  });
  
  var RFP_Icode  = $('#RFPICode').html();
  var ProposalId = $('#ProposalId').html();
  var OldDataDelete = {
    RFPICode	  : RFP_Icode,
    RFPStatus	  : status_code
  }

  var Oldrfpdelete = {
    Method : "PostOldRFPDelete",
    Data   :  OldDataDelete
  }

  var DeleteOld_RFPData = PostDataCall(Oldrfpdelete);
  if(DeleteOld_RFPData['IsSuccess'] == true) {
    var swalEMRSucc = {
      title: 'Success!',
      text: DeleteOld_RFPData['Message'],
      icon: "success"
    }
      var Data = {
        Token          : AssignRfpSecurityToken,
        Comments       : close_comment, 
        StatusCode     : status_value,
        RFPId          : null,
        RFPIcode       : null,
        ProposalId     : ProposalId
      };
      var DeleteData = {
        Method: "PostDeleteRFP",
        Data: Data
      }
    
      var DeleteRFP_Data = PostDataCall(DeleteData);
  }else {
    var swalEMRErr = {
        title: 'Warning!',
        text: DeleteOld_RFPData['Message'],
        icon: "error"
    }
    swalAlert(swalEMRErr); 
  }
  
  if(DeleteRFP_Data['IsSuccess'] == true) {
    var swalEMRSucc = {
        title: 'Success!',
        text: DeleteRFP_Data['Message'],
        icon: "success"
    }
    swalAlert(swalEMRSucc);
    $("#deleteProposalModal").modal("hide"); 
    // CKEDITOR.instances.deleteProposal_comment.setData('');
    deleteProposal_comment_dxEditor.option("value", "")
    getProposalList();
  }else {
    var swalEMRErr = {
        title: 'Warning!',
        text: DeleteRFP_Data['Message'],
        icon: "error"
    }
    swalAlert(swalEMRErr); 
  }
}

